  false,\n\t\"url\": null,\n\t\"notes\": \"Submarine canyons cut into the edge of
  the continental shelf and the continental slope along much of the U.S. Atlantic
  coast. Three canyons along the southern edge of Georges Bank (Lydonia, Oceanographer,
  Gilbert) were dredged and cored to study their modern sediments and the lithologies
  and ages of the rocks exposed on the canyon walls. As part of this study eleven
  cores were taken and the results of the textural analyses on the surficial sediments
  are contained in this data set.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
